import React from 'react';
import styles from "./Contact.module.css"

function Contact() {
  return (
    <div id="contact" className={styles.contact}> 
      <div>Contact</div>
      <div>感謝關注！ 任何資訊還請聯繫以下資訊：zhangshangdong888855@gmail.com</div>
      <div>若搜尋Mugino12138添加本人微信</div>
    </div>
  );
}

export default Contact;
